import React, {Component} from 'react';
import './HomePage.css';

const homePic = require('../Assets/Assets/bg.jpg');

class HomePage extends Component {
    render() {
        return (
            <div className="mainPage">
                <img src={homePic} alt="redis" />
                <div className="redisInfo">
                </div>
            </div>
        )
    }
}

export default HomePage;
